//
// Arguments    : const double b[7]
//                const double a[7]
//                const double x[1036]
//                const double zi[6]
//                double y[1036]
// Return Type  : void
//
static void filter(const double b[7], const double a[7], const double x[1036],
                   const double zi[6], double y[1036])
{
  int k;
  int naxpy;
  int j;
  double as;
  for (k = 0; k < 6; k++) {
    y[k] = zi[k];
  }

  memset(&y[6], 0, 1030U * sizeof(double));
  for (k = 0; k < 1036; k++) {
    naxpy = 1036 - k;
    if (!(naxpy < 7)) {
      naxpy = 7;
    }

    for (j = 0; j + 1 <= naxpy; j++) {
      y[k + j] += x[k] * b[j];
    }

    naxpy = 1035 - k;
    if (!(naxpy < 6)) {
      naxpy = 6;
    }

    as = -y[k];
    for (j = 1; j <= naxpy; j++) {
      y[k + j] += as * a[j];
    }
  }
}

//
// Arguments    : double x[1036]
// Return Type  : void
//
static void flipud(double x[1036])
{
  int i;
  double xtmp;
  for (i = 0; i < 518; i++) {
    xtmp = x[i];
    x[i] = x[1035 - i];
    x[1035 - i] = xtmp;
  }
}

//
// Arguments    : const double f[999]
//                const double PSD[999]
//                const double tH[2]
//                double fselect_data[]
//                int fselect_size[2]
//                double PSDselect_data[]
//                int PSDselect_size[2]
//                double *L
//                double *P
// Return Type  : void
//
static void get_psd_features(const double f[999], const double PSD[999], const
  double tH[2], double fselect_data[], int fselect_size[2], double
  PSDselect_data[], int PSDselect_size[2], double *L, double *P)
{
  int trueCount;
  int ixstart;
  boolean_T b0;
  boolean_T b1;
  int partialTrueCount;
  boolean_T bv0[999];
  boolean_T bv1[999];
  short tmp_data[999];
  short L1_data_idx_0;
  short b_tmp_data[999];
  int itmp;
  boolean_T exitg1;

  // selectPSD
  trueCount = 0;
  for (ixstart = 0; ixstart < 999; ixstart++) {
    b0 = (f[ixstart] >= tH[0]);
    b1 = (f[ixstart] <= tH[1]);
    if (b0 && b1) {
      trueCount++;
    }

    bv0[ixstart] = b0;
    bv1[ixstart] = b1;
  }

  fselect_size[0] = 1;
  fselect_size[1] = trueCount;
  partialTrueCount = 0;
  trueCount = 0;
  for (ixstart = 0; ixstart < 999; ixstart++) {
    if (bv0[ixstart] && bv1[ixstart]) {
      fselect_data[partialTrueCount] = f[ixstart];
      partialTrueCount++;
    }

    if (bv0[ixstart] && bv1[ixstart]) {
      trueCount++;
    }
  }

  PSDselect_size[0] = 1;
  PSDselect_size[1] = trueCount;
  partialTrueCount = 0;
  trueCount = 0;
  for (ixstart = 0; ixstart < 999; ixstart++) {
    if (bv0[ixstart] && bv1[ixstart]) {
      PSDselect_data[partialTrueCount] = PSD[ixstart];
      partialTrueCount++;
    }

    if (bv0[ixstart] && bv1[ixstart]) {
      trueCount++;
    }
  }

  if (trueCount > 1) {
    trueCount = 0;
    for (ixstart = 0; ixstart < 999; ixstart++) {
      if (bv0[ixstart] && bv1[ixstart]) {
        trueCount++;
      }
    }

    partialTrueCount = 0;
    for (ixstart = 0; ixstart < 999; ixstart++) {
      if (bv0[ixstart] && bv1[ixstart]) {
        b_tmp_data[partialTrueCount] = (short)(ixstart + 1);
        partialTrueCount++;
      }
    }

    ixstart = 1;
    *P = PSD[b_tmp_data[0] - 1];
    itmp = 1;
    if (trueCount > 1) {
      if (rtIsNaN(PSD[b_tmp_data[0] - 1])) {
        partialTrueCount = 2;
        exitg1 = false;
        while ((!exitg1) && (partialTrueCount <= trueCount)) {
          ixstart = partialTrueCount;
          if (!rtIsNaN(PSD[b_tmp_data[partialTrueCount - 1] - 1])) {
            *P = PSD[b_tmp_data[partialTrueCount - 1] - 1];
            itmp = partialTrueCount;
            exitg1 = true;
          } else {
            partialTrueCount++;
          }
        }
      }

      if (ixstart < trueCount) {
        while (ixstart + 1 <= trueCount) {
          if (PSD[b_tmp_data[ixstart] - 1] > *P) {
            *P = PSD[b_tmp_data[ixstart] - 1];
            itmp = ixstart + 1;
          }

          ixstart++;
        }
      }
    }

    ixstart = 1;
    partialTrueCount = 1;
    L1_data_idx_0 = (short)itmp;

    //      [P1,L1] = findpeaks(PSDselect,'SortStr','descend');
  } else {
    ixstart = 0;
    partialTrueCount = 0;
  }

  if (!((ixstart == 0) || (partialTrueCount == 0))) {
    partialTrueCount = 0;
    for (ixstart = 0; ixstart < 999; ixstart++) {
      if (bv0[ixstart] && bv1[ixstart]) {
        tmp_data[partialTrueCount] = (short)(ixstart + 1);
        partialTrueCount++;
      }
    }

    *L = f[tmp_data[L1_data_idx_0 - 1] - 1];
  } else {
    *L = 0.0;
    *P = 0.0;
  }
}

//
// Arguments    : const double x_data[]
//                const int x_size[1]
// Return Type  : double
//
static double mean(const double x_data[], const int x_size[1])
{
  double y;
  int k;
  if (x_size[0] == 0) {
    y = 0.0;
  } else {
    y = x_data[0];
    for (k = 2; k <= x_size[0]; k++) {
      y += x_data[k - 1];
    }
  }

  y /= (double)x_size[0];
  return y;
}

